import PopularRestaurant from "./PopularRestaurant";
import "../HomePage.scss";
import claro from "../../../assets/claro.png";
import lumina from "../../../assets/mizlala-gret-mullet-fillet.png";
import tiger from "../../../assets/screen-shot-2019-01-06-at-10-57-26.png";
import { Fragment } from "react";

const DUMMY_DATA = [
  {
    id: "m1",
    restaurantImage: claro,
    name: "Claro",
    chef: "Ran Shmueli",
    signatureName: 'Pad Ki Mao',
    signatureImage: padKiMao,
    description: '',
    icon: spicy,
    price: 88
  },
  {
    id: "m2",
    restaurantImage: lumina,
    name: "Lumina",
    chef: "Meir Adoni",
    signatureName: 'Garbanzo Frito',
    signatureImage: garbanzo,
    description: '',
    icon: '',
    price: 98
  },
  {
    id: "m3",
    restaurantImage: tiger,
    name: "Tiger Lilly",
    chef: "Yanir Green",
    restaurant: 'Tiger Lilly',
    signatureName: 'Smoked Pizza',
    signatureImage: pizza,
    description: '',
    icon: vegiterian,
    price: 65
  },
];

const DummyData: React.FC<{ name: string; chef: string; image: string }> = (
  props
) => {
  return (
    <Fragment>
      <div className="popular-container">
        <img src={props.image} alt="popular-img"></img>
        <h2>{props.name}</h2>
        <p>{props.chef}</p>
      </div>
    </Fragment>
  );
};

export default DummyData;
